function decompress(encoded) {
    const temp = encoded / 4096.0;
    const xZeroTo4095 = Math.floor(temp);
    const stx = xZeroTo4095 / 4095.0;
    const sty = (encoded - xZeroTo4095 * 4096.0) / 4095.0;

    return [stx, sty];
}
